import { Route, Navigate } from "react-router-dom";
import React, { FC } from "react";

interface Props {
  path: any;
  element: any;
}

const PrivateRoute: FC<Props> = ({ children, ...rest }) => {
  console.log("prive route works");
  return <Route {...rest}>{children}</Route>;
};

export default PrivateRoute;
